('Marie Louise Hartman', '11.03.1959, Berkeley U.S.A', 'amerykańska', 'od 1984', 'www.nina.com', 'W 1982 podczas nauki w szkole pielęgniarskiej Nina zaczęła pracować jako striptizerka aby zarobić na edukację. Szybko wpadła w oko\r\nróżnej maści napaleńcom - między innymi Japończykom odwiedzającym bar w San Francisco. To poniekąd oni nadali jej pseudonim Nina - był dla nich łatwy do wymówienia. \r\nDo branży dołączyła w 1984 występując w "Educating Nina" - szybko zdobywając popularność. ', 0, 'Ninę śmiało można nazwać weteranką. Jest jedną z najbardziej\r\nrozpoznawalnych aktorek w branży(posiada również pseudonim "bubble but" - bąbelkowy tyłek) Wystąpiła w około 1000 filmów i co najważniejsze nadal jest aktywna.\r\nJej łapczywa, wiecznie niezaspokojona, biseksualna cipka niczym nie pogardzi. Począwszy od sztucznych kutasów poprzez inne pizdeczki na wielkich czarnych pałach skończywszy.\r\nKażdy walikonik musiał gdzieś, kiedyś słyszeć o Ninie. Jeśli jej nie poznałeś, koniecznie wyciągnij pyte ze spodni i nadrób zaległości.', 'Nina Hartley', 0, 'podrasowane'),
('Dóra Varga', '14.12.1987, Budapeszt, Węgry', 'węgierska', 'od 2007', 'alettaocean.com', 'Historia Aletty zaczyna się gdy będąc 19-sto letnią studentką ekonomii zdobyła węgierski tytuł miss turystów. (Znalazła się również w finałowej szóstce krajowego konkursu miss piękności).\r\nDo porno-branży dołączyła w w Kwietniu 2007 (dzięki swojemu byłemu chłopakowi) rozpoczynając od hardcorowych scen. Szybko została zauważona przez producentów zza oceanu po czym rozpoczęła pracę dla wielu znanych wytwórni.', 1, 'Aletta przeszła 3 operacje powiększania biustu. Pierwsza na rozmiar 34C potem na D i ostatecznie na DD. W Styczniu 2012 przeszła operację wstawienia implantów ust co ogłosiła na twiterze stwierdzeniem: "oto moje nowe usta, operacja była bolesna". Gwiazda nie wyklucza również liposukcji. Aletta twierdzi, że w prywatnym życiu uwielbia seks analny jednak zawsze się denerwuje przed kręceniem sceny tego typu. Stres zanika gdy zdjęcia się rozpoczynają. Według niej najlepszymi sposobami na orgazm jest właśnie anal i dwa kutasy w cipce.', 'Aletta Ocean', 0, 'podrasowane'),
('Asa Takigami', '03.01.1986, Nowy Jork U.S.A', 'amerykańska', 'od 2006', 'asaakira.com', 'Asa jest urodzoną w Stanach córką Japońskich imigrantów. Między szóstym a trzynastym rokiem życia mieszkała w Japonii uczęszczając do Amerykańskich szkół. Dziadek Asy przez 45 lat był dyplomatą. W życiu prywatnym spotykała się z mężczyznami z branży porno, między innymi z : Spice Boyem i Rocco Reedem. W 2012 poślubiła Toniego Ribas''a - producenta, aktora i reżysera porno. Obecnie gwiazda mieszka w Los Angeles.', 0, '\r\nKarierę rozpoczęła mając 19 lat jako domina oraz striptizerka w nowojorskim hustler club. Początek jej medialnej przygody to rok 2006 - Asa brała udział w audycji radiowej "Bubba the Love Sponge". W trakcie tworzenia programu poznała aktorkę z branży XXX - Ginę Lynn, która zaproponowała jej pracę przy kręceniu pornosów. Mając 20 lat zagrała w kilku produkcjach lesbijskich. Swą pierwszą scenę z mężczyzną zaliczyła w 2008, dzięki czemu dorobiła się tytułu odkrycia roku. W następnych latach wielokrotnie bywała nominowana i nagradzana w różnych kategoriach. Oprócz porno Asa występowała również w parodiach porno i w kinie niezależnym. Jest jedną z najbardziej rozpoznawalnych azjatyckich gwiazd.', 'Asa Akira', 0, 'podrasowane'),
('Alexia Roy', '16.09.1981, Gibraltar - Wielka Brytania', 'francusko-włoska', 'od 2008', 'www.theavaaddams.com', 'Wkrótce po narodzinach Ava wraz z rodzicami przeniosła do Houston w Teksasie. Jej tata miał pochodzenie francusko-włoskie natomiast matka francusko-hiszpańskie. W związku z narodowościowym mixem Ava płynnie mówi po angielsku, hiszpańsku i żabojadzku. Będąc 18-latką rozpoczęła pracę jako modelka a w 2004 pojawiła się w Playboyu. ', 1, 'Pracę modelki kontynuowała do 2008 gdy za namową aktorki porno(Renny Ryann) zaczęła pracę w branży filmów dla dorosłych. Debiut zaliczyła w studiu Reality Kings. Szybko stała się rozpoznawalną aktorką typu MILF pracując dla różnych wytwórni : Bangbros, Brazzers czy Naughty America. Wielokrotnie nominowana do różnorakich nagród branżowych. Oprócz pornosów Ava wystąpiła w serialu i dwóch horrorach. Natura obdarzyła ją pokaźnymi balonami jednak jej to nie wystarczyło. Gdy urodziła syna w 2011 roku jej balony awansowały do rozmiaru D. Kolejny wzrost cycków nastąpił w 2012 gdy aktorka przeszła zabieg powiększenia do potrójnego D. Ava lubi też tatuaże - ma ich kilka.', 'Ava Addams', 9, 'podrasowane'),
('Thea Alexis Samper', '25.05.1985, Panama', 'amerykańska', 'od 2007', 'www.alexistexas.com', 'Alexis jest amerykanką jednak w wyniku zbiegu okoliczności urodzona została w amerykańskiej bazie wojskowej w Panamie. Dziecieństwo spędziła na południu stanów, w Castroville. Jej przodkowie mieli różnorodne korzenie : niemieckie, norweskie i portorykańskie. Zanim została gwiazdą porno pracowała jako osobisty asystent w domu opieki społecznej, oprócz tego była również klubową barmanką.', 2, 'W wieku 21 lat rozpoczęła porno-karierę, pierwszą scenę nakręciła w paźdierniku 2006, wkrótce potem przeniosła się do Los Angeles.\r\nDość szybko została zauważona przez ludzi z branży i nominowano ją do nagrody za odkrycie roku. Kolejnym(ale nie jedynym) wyróżnieniem było wybranie jej jako jednej z 12 najlepszych kobiet w porno według magazynu Maxim. Alexis znana jest przede wszystkim za swoje dupsko. Charakterystyczny kształt i pokaźne rozmiary zapewniają jej dużą popularność wśród wielbicieli pulchnych kształtów. Kilkukrotnie AVN przyznało jej tytuł najlepszego tyłka - raz otrzymała nawet nagrodę za... najbardziej heroiczny tyłek w scenie analnej. Nawet jeśli nie przepadasz za większymi rozmiarami warto rzucić okiem na tą suczkę - oprócz dupska ma też inne atuty. Cycki Alexis są naturalne.', 'Alexis Texas', 17, 'naturalne'),
('Amy Anderssen', '04.05.1985, Leamington, Kanada', 'kanadyjska', 'od 2006 do 2016', 'amyanderssen.xxx', 'Amy urodziła się w rodzinie pochodzenia libańskiego, mając 20 lat straciła dziewictwo i wkrótce jak sama twierdzi została seksoholiczką. Niedługo potem odpowiedziała na ogłoszenie wytwórni, która szukała aktorek do hardcorowego porno i tak zaczęła się jej kariera. W jednym z wywiadów Amy wspomniała to wydarzenie : "Mój trzeci seks zaliczyłam na planie filmu porno".', 0, 'Aby rozkręcić swoją świeżo rozpoczętą karierę Amy próbowała znaleźć pracę w U.S.A jednak po napotkaniu problemów ze służbą celną przeniosła się do Londynu. Będąc w U.K przeszła jedną z 5 operacji powiększenia biustu. Zaczęła gdy miała lat 19 i regularnie co 6 miesięcy powiększała aż dobiła do 2000 cm3!\r\nPo roku spędzonym w Wielkiej Brytanii zaczęła wyrabiać sobie znajomości w Los Angeles, Las Vegas i Miami. Jej popularność znacząco wzrosła gdy uruchomiła swoją stronę www. Amy uwielbia ostry seks a w szczególności brutalne GangBangi, poniżanie i bukkake. Gwiazda przyznaje, że jej cyce są już za duże. Z powodu swoich pokaźnych rozmiarów pojawiły się problemy zdrowotne, przyczynili się do tego również niekompetentni lekarze.', 'Amy Anderssen', 0, 'podrasowane'),
