('Sylvie Tomčalová', '12.02.1976, Kyjov, obecnie Czechy.', 'czeska', 'od 1997 do 2001', 'silviasaint.com', 'Ukończywszy szkołę średnią studiowała przez dwa lata zarządzanie w Brnie. Później pracowała jako menadżer hotelu, była koordynatorką księgowego i koordynatorką ds. marketingu. Te zajęcia nie były zbyt dochodowe, Silvia nie czuła się spełniona finansowo i dlatego podjęła pracę jako modelka reklamująca bieliznę.', 0, 'Niedługo później została ulubienicą miesiąca amerykańskiego miesięcznika "Penthouse". Jej znajomy namówił ją na wzięcie udziału w porno-castingu i zagrała w pierwszym filmie. Za występ otrzymała nagrodę dla najlepszej debiutantki przyznawane przez magazyn AVN.\r\nNa swoim koncie ma mnóstwo scen analnych, oralnych, lesbijskich i wtyczek. Wielu fanów zyskała również dzięki występowaniu w roli surowej dominującej kobiety. W Marcu 2001 oficjalnie ogłosiła swe odejście z branży, chociaż pozostała aktywna jako producentka i czasami brała udział w filmach z innymi dupeczkami.', 'Silvia Saint', 0, 'nieznany'),
('Kirsty Hill', '17.01.1984, Llanielli', 'brytyjska', 'od 2005 do 2017', 'onlyfans.com/sophiedeelive', 'Po ukończeniu szkoły Sophie imała się różnych zajęć jak praca w kawiarni czy handel obwoźny(próbowała opchnąć jakieś graty krążąc po domach). Porzuciła niskodochodowe zajęcia i została tancerką erotyczną w klubie w Birmingham, wkrótce zaproponowano jej pracę modelki topless.', 0, 'Na początku 2005 roku przeprowadziła się do Kaliforni aby rozpocząć porno karierę. Przez ponad 10 lat wystąpiła w około 560 filmach.\r\nZnana jest z tego, że robi chyba wszystko - GangBangi, połykanie, sado-maso i sporo możnaby jeszcze wymieniać. W 2010 roku wyszła za mąż za murzyna i razem nakręcili parę pornosów. W 2013 doszło do rozwodu. Prywatnie Sophie jest spokojną, niewinną suczką jakiej możnaby się spodziewać po jej buźce. Lubi komedie romantyczne, muzykę pop, podróze i ma dwa psy. Twierdzi, że jest uzależniona od reality show.', 'Sophie Dee', 0, 'podrasowane'),
('Amanda Friedland', '23.09.1982, Armstrong - Kanada', 'kanadyjska', '2000 - 2005 i 2006 - 2017', 'brak', 'Zaraz po ukończeniu szkoły średniej zaczęła zarabiać swoim ciałem. Występowała na sex-kamerkach, tańczyła w barze ze striptizem. Jak wiele jej koleżanek po fachu przeniosła się do Kaliforni aby podbić branżę porno.', 0, 'Już jako nastolatka raczkująca w branży kręciła hardcorowe pornosy. Zaraz po nakręceniu pierwszego filmu załapała się na kolejny kontrakt i tak jej kariera nabrała tempa. Po 5 latach zrobiła przerwę na powiększenie cycków, po czym zaliczyła wielki powrót z podrasowanymi zderzakami. Przyczyniła się do wybuchu seks skandalu gdy wyszedł na jaw jej romans z jednym ze znanych stróżów prawa. Niestety w wieku 35 lat zmarła w domu swojej matki - przyczyna jej śmierci pozostaje niewyjaśniona.', 'Shyla Stylez', 0, 'podrasowane'),
('Cristina Molina', '21.07.1963, Buenos Aires, Argentyna', 'argentyńska', 'od 2003', 'sexyvanessa.com', 'Tą dupeczkę kojarzy chyba każdy fan mamusiek. Do porno dołączyła będąc już po 40-tce dlatego każdy film z jej udziałem zalicza się do kategorii MILF. Niewiele wiemy na temat jej życia przed rozpoczęciem kariery.', 0, 'Pomimo iż ma ponad 50 lat nadal chętnie pokazuje cipkę całemu światu, a chętnych do oglądania nie brakuje. Nic dziwnego, jak na swoje lata jest w dobrej formie.', 'Sexy Vanessa', 0, 'podrasowane'),
('Tanya Thomas', '31.03.1979, Liverpool, Wielka Brytania', 'brytyjska', 'od 2009', 'tanyatate.com', 'Poszukując czegoś bardziej emocjonującego niż praca w biurze 30 letnia Tanya decyduje się na pracę dla brytyjskiej porno-wytwórni. Przez pierwszych kilka lat współpracuje jedynie z rodzimymi producentami po czym zostaje zauważona przez amerykańską agencję i jej życie zostaje podzielone na Londyn i Los Angeles.', 0, 'Jest fanką komiksów, bohaterowie jej ulubionych mają pseudonimy, których oba człony zaczynają się na tą samą literę - stąd też jej ksywka.Tanya to naprawdę znana mamuśka, 6 razy wygrała tytuł : "MILF roku", wielokrotnie była też nominowana w innych kategoriach. Tanya jest znana tównież ze swojego zamiłowania do tzw. "cosplay" - amerykańskie bale przebierańców. Prowadzi swoją stronę internetową poświęconą przebierankom www.justalottatanya.com', 'Tanya Tate', 0, 'podrasowane'),
('Linda Ann Hopkins', '25.07.1976, Great Falls, U.S.A', 'amerykańska', 'od 1999', 'terapatrick.com', 'Jej matką jest Tajka a ojciec jest europejską mieszanką genów brytyjskich i holenderskich. Gdy miała 10 lat jej matka ją opuściła i została pod opieką ojca - luzackiego hipisa. Gdy miała 14 lat przeniosła się do Japonii aby pracować dla agencji modelek. Miała pecha gdyż natrafiła na napalonego zboczeńca, który podczas sesji podawał jej alkohol i valium. Po pewnym czasie zaniepokojony ojciec sprowadził ją z powrotem do domu. Po ukończeniu szkoły średniej została licencjonowaną pielęgniarką i zdobyła licencjat z mikrobiologii.', 0, 'Pod koniec lat 90 Tera zaczęła pojawiać się w produkcjach softcore''owych. W 2000 roku przeszła na hardcorowe porno. Zaczęła pojawiać się na okładkach magazynów dla panów i zdobywać takie tytuły jak "pieszczoszek miesiąca" czy nawet "pieszczoszek roku". Jej kariera szybko nabierała tempa i stała się jedną z najbardziej rozpoznawalnych aktorek xxx. Ma na koncie setki filmów w różnym stylu. Jej dorobek jest różnorodny jednak warto podkreślić, że filmy typu rogacz są jak najbardziej prawdziwe. Chodzi o to, że jej prawdziwy mąż patrzy jak dyma się z innymi facetami. Już od paru lat nie pracuje dla nikogo, ma własną wytwórnię i można ją podziwiać na sex-kamerkach.', 'Tera Patrick', 0, 'podrasowane');
